def is_majority(arr, n, element):
    left = 0
    right = n - 1
    while left <= right:
        mid = left + (right - left) // 2
        if arr[mid] == element:
            break
        elif arr[mid] < element:
            left = mid + 1
        else:
            right = mid - 1
    if arr[mid] != element:
        return False
    count = 1
    i = mid - 1
    while i >= 0 and arr[i] == element:
        count += 1
        i -= 1
    i = mid + 1
    while i < n and arr[i] == element:
        count += 1
        i += 1
    return count > n // 2

