def move_zero(nums):
    zero = 0  # count the occurrences of zero
    for i in range(len(nums)):
        if nums[i] != 0:
            nums[i], nums[zero] = nums[zero], nums[i]
            zero += 1
    return nums

def move_zero(lst):
    count = 0
    for i in range(len(lst)):
        if lst[i] != 0:
            lst[count] = lst[i]
            count += 1
    for i in range(count, len(lst)):
        lst[i] = 0
    return lst

